import React from 'react';

import './App.css';

const handleClick = () =>{
  fetch('http://')
    .then(response => response.json())

}

function App() {
  return (
    <div className="App">
      <button className="btn" onClick={handleClick()}>OK</button>
    </div>
  );
}

export default App;
